window.bookSummaryJSON = "<p><b>Luck knew two things when he left Harem Station months ago.</b></p> <p>One. The silver-haired Cygnian Princess Nyleena was still safely frozen away in her cryopod. <br> And two. There was a good chance she was his soul mate.</p> <p>He left anyway.</p> <p>Nyleena is what you might call feisty. Or sassy. Or maybe just...<i>feral</i>. She is wild. Much too wild for Luck’s taste. But now that he’s home there’s no way to deny it. </p> <p>Like it or not, she is his.</p> <p>Lucky for him, all Cygnian Princesses have one true weakness. They cannot resist cooking up crazy plans to tackle unsolvable problems. And he’s going to use that irresistible urge to tame her savage spirit.</p> <p>Nyleena has plans of her own and none of them involve Luck. She is out for blood. All the people who made her life hell will be dealt with, and she’s going to find every single one of them and take them out.</p> <p>Right after she solves this one last unsolvable problem....</p> <p>How not to fall in love with your soul mate.</p> <p><i>Lady Luck</i> is a sexy, love/hate story about a wild, savage princess, six hot brothers trying to tame her, bad relationship advice from killer sexbots, your favorite evil, but misunderstood, dragonbee bot, and a repentant AI trapped in a sex prison with a succubus.</p> <p>Includes a special bonus note from the author.</p>"; 
